import React from 'react'

function Posts({ post }) {


    const allPosts = post.map((post) => {
        return (
            <Post
                key={post.id}
                username={post.username}
                title={post.title}
                message={post.message}
                profilesrc={post.profilesrc}
                image={post.Postimage}
                />
        )
    })

return 

}

export default PostContainer
